Part 2: This determinedly twisted &quot;sequel&quot; enhances the simple erotic lesbian vampire tale by introducing a new band of go-go dancing girl ghouls, a swinging bloodsucker from the psychedelic past, and an insatiably fetishistic podiatrist. Inspired dementia from Brain Escape Pictures. 
